import React, { useEffect, useState } from "react";
const ListComp = () => {
  const [Apidata, setData] = useState();

  const fetchApi = async (url) => {
    try {
      const response = await fetch(url);
      const data = await response.json();
      setData(data);
    } catch (error) {
      console.log(error);
    }
  };
