  //         console.log(item);
  //       });
  //   }
  useEffect(() => {
    let url = "https://api.minebrat.com/api/v1/states";
    fetchApi(url);
  }, []);
  return (
    <>
      {console.log(Apidata)}
      <h1>Hello</h1>
      <ul>
        {Apidata.map((eachItem) => {
          console.log(eachItem);
        })}
      </ul>
    </>
  );
};
export default ListComp;
